import * as t from '@babel/types';
import { NodePath } from '@babel/traverse';
import API from '../../../../../API';
/**
 * 将 JSX 片段保存起来，用于生成静态化的原生模板
 *
 * @export
 * @returns
 */
export default function render(api: API): {
    pre(state: any): void;
    visitor: {
        JSXElement: (path: NodePath<t.JSXElement | t.JSXFragment>, state: any) => void;
        JSXFragment: (path: NodePath<t.JSXElement | t.JSXFragment>, state: any) => void;
    };
};
